ELECTION UPDATE FROM PCG-Los Angeles!! 
@TFCNewsNow
 
@StevieAngeles
 #OverseasVoting #Halalan2022 #Eleksyon2022

Comelec Comm Marlon Casquejo on posts circulating not to shade anything on the ballot opposite VP Leni Robredo's name: Totoong fake news yan. Kasi pag tiningnan mo yung balota, yung bilog sa likod, hindi naman siya tatama sa bilog din sa kabila. 
@gmanews
 #Eleksyon2022

Casquejo on complaints that some overseas voters have not yet received their ballots: Naglabas na kami ng advisory to all posts using the mail voting. Kapag hindi nila natanggap ang kanilang balota, they can go to the post or the embassy. 
@gmanews
 #Eleksyon2022

Comelec Comm George Garcia on Voter Information Sheet distribution: 57,200,456  or 87.05% of the total 65,709,536 have been delivered to voters. 
@gmanews
 #Eleksyon2022

Casquejo: And then after that one kapag may bakante na po tayong vote counting machine, yun na po yung gagamitin natin. Nasa procedure natin yan. What is important is the SD card and the official ballots. 
@gmanews
 #Eleksyon2022

Casquejo on election day malfunctions: In the middle of voting, biglang pumalya yung isang vote counting machine. Hindi natin alam ang dahilan. Pina-repair natin pero hindi umabot. Wala na rin po tayong contingency. The election will continue. 
@gmanews
 #Eleksyon2022

Casquejo also reported that in the ongoing FTS, only 40 SD cards so far were found defective. All of them had been replaced. In #Eleksyon2019, there were 2,000 defective SD cards on Day 1 alone. 
@gmanews
 #Eleksyon2022

Casquejo says the defective VCMs have been brought to the Comelec warehouse in Sta Rosa, Laguna for repairs. There are also 1,100 contingency VCMs in case some machines break down on election day & regional hubs where the VCMs can be brought for repairs. 
@gmanews
 #Eleksyon2022

Casquejo: Majority of which is yung mga dumi sa scanning kaya hindi siya nababasa. I can assure the public na hindi po tayo magkakaproblema sa ating vote counting machines. 
@gmanews
 #Eleksyon2022

Here are some reminders from the Comelec against votebuying and voteselling, on the liquor ban, against wagering on the results of the elections, prohibitions on wearing items with names or faces of candidates inside polling places, etc. 
@gmanews
 #Eleksyon2022
